import React, { useState } from "react";
import {Pagination} from 'react-bootstrap';
import "./pagination.css"

export default function PageTurner() {
  const [count, setCount] = useState(0)
  const handleClickNext = () =>{
    setCount(count + 1)
  }
  const handleClickBack= () =>{
    setCount(count - 1)
  }
  return (
    <> 
    <div style={{ height:"0.8rem"}}>&nbsp;</div>  
    <Pagination className="custom-pagination">
    <Pagination.First />
    <Pagination.Prev />
    <Pagination.Item>{1}</Pagination.Item>
    <Pagination.Ellipsis />

    <Pagination.Item>{count}</Pagination.Item>
    <Pagination.Item disabled>{11}</Pagination.Item>
    <Pagination.Item active>{12}</Pagination.Item>
    <Pagination.Item disabled>{13}</Pagination.Item>
    <Pagination.Item >{14}</Pagination.Item>

    <Pagination.Ellipsis />
    <Pagination.Item>{20}</Pagination.Item>
    <Pagination.Next onClick={handleClickNext}/>
    <Pagination.Last onClick={handleClickBack} />
  </Pagination></>
 
    
  );
}
